/article/abs/pii/S095741741830143X)"]},{"cell_type":"markdown","id":"c52d6e1a","metadata":{"papermill":{"duration":0.006138,"end_time":"2023-02-02T06:01:17.343908","exception":false,"start_time":"2023-02-02T06:01:17.33777","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"f70ca796","metadata":{"papermill":{"duration":0.006099,"end_time":"2023-02-02T06:01:17.356088","exception":false,"start_time":"2023-02-02T06:01:17.349989","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"15e8c3b9","metadata":{"execution":{"iopub.execute_input":"2023-02-02T06:01:17.372539Z","iopub.status.busy":"2023-02-02T06:01:17.370612Z","iopub.status.idle":"2023-02-02T06:01:17.42534Z","shell.execute_reply":"2023-02-02T06:01:17.42326Z"},"papermill":{"duration":0.065605,"end_time":"2023-02-02T06:01:17.427994","exception":false,"start_time":"2023-02-02T06:01:17.362389","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>posit